SELECT a11.*, am2.* FROM sys.assemblies AS a11 INNER JOIN sys.assembly_modules AS am2 ON am2.assembly_id = a11.assembly_id WHERE a11.name = 'CreateAssemblyFunctions3'; GO
CREATE FUNCTION fnCompareStringsCaseSensitive (@strA nvarchar(128), @strB nvarchar(128)) returns int AS EXTERNAL NAME CreateAssemblyFunctions3 .[CreateAssemblyFunctions3.SqlFunctionMethodsForSprocs] .CompareCaseSensitiveNet; GO SELECT * FROM sys.objects WHERE name = 'fnCompareStringsCaseSensitive';
